import React from "react";
import {Redirect, Route, Switch} from "react-router";
import {LoginPage} from "./app/pages/LoginPage";
import {HomePage} from "./app/pages/HomePage";
import {NavBar} from "./app/components/ui/NavBar";
import {NavLink} from "react-router-dom";
import {SiteMenu} from './app/components/ui/SiteMenu';
import {SiteContent} from './app/components/ui/SiteContent';
import {ResultsPage} from './app/pages/ResultsPage';
import styled from 'styled-components';
import {EquinorIcon, Icon} from './app/assets/svg/EquinorIcon';
import {IProps as EquinorIconProps} from './app/assets/svg/EquinorIcon';

const NotFound = () => (
  <div>
    Page not found
  </div>
);

const MenuLink = styled(NavLink).attrs({
  activeStyle: {
    color: '#007079'
  }
})`
  display: flex;
  flex-direction: row;
  padding: 20px 20px 20px 50px;
  align-items: center;
  color: black;
  text-decoration: none;
  font-family: Equinor,serif; // TODO: add Equinor-bold font
`;

const MenuIconStyled = styled.div<React.FunctionComponent>`
  margin-right: 20px;
`;

const MenuIcon: React.FunctionComponent<EquinorIconProps> = (props) => (
  <MenuIconStyled>
    <EquinorIcon {...props}/>
  </MenuIconStyled>
);

export const App = () => (
  <div style={{height: '100%'}}>
    <NavBar/>
    <SiteContent>
      <SiteMenu>
        <MenuLink to="/calculator">
          <MenuIcon icon={Icon.CALCULATOR}/>
          Calculator
        </MenuLink>
        <MenuLink to="/results">
          <MenuIcon icon={Icon.RESULT}/>
          Results
        </MenuLink>
      </SiteMenu>
      <Switch>
        <Redirect exact from="/" to="/calculator"/>
        <Route path="/login" component={LoginPage}/>
        <Route path="/calculator" component={HomePage}/>
        <Route path="/results" component={ResultsPage}/>
        <Route path="/" component={NotFound}/>
      </Switch>
    </SiteContent>
  </div>
);
